export default {
	onClickNavigate: () => {
		if(FeedbackType.selectedOptionValue == 'peer'){
			navigateTo('PeerFeedback', {}, 'SAME_WINDOW')
		}
		else if(FeedbackType.selectedOptionValue == 'self'){
			navigateTo('SelfFeedback', {}, 'SAME_WINDOW')
		}
		else if(FeedbackType.selectedOptionValue == 'reviewer'){
			navigateTo('ReviewerFeedback', {}, 'SAME_WINDOW')
		}
		else{
			showAlert('Not Found', 'Error')
		}
	},
}
